        <Def>
            <main>
                <h1>404: PAGE NOT FOUND</h1>
                <p>Oops, sorry, we cant find this page!</p>
                <div>
      <img src="/images/chakra.webp" alt="cosmic chakra" />

    </div>
            </main>
        </Def>
    )
 }

module.exports = error404

